<input id="inp" type="file" accept="image/*" hidden="" onchange="let r=new FileReader();r.onload=e=>box.innerHTML='<img src='+e.target.result+'>';r.readAsDataURL(this.files[0])">

<script>
const box=document.getElementById('box');
// 拖拽
window.ondragover=e=>e.preventDefault();
window.ondrop=e=>{
  e.preventDefault();
  let f=e.dataTransfer.files[0];
  if(f&&f.type.startsWith('image/')){
    let r=new FileReader();
    r.onload=ev=>box.innerHTML='<img src="'+ev.target.result+'">';
    r.readAsDataURL(f);
  }
}
</script>

</body></html>
